	foreach($sett_chunks as $chunk)
	{
		$query = "REPLACE INTO `adiinviter_settings` (`name`, `value`) VALUES ";
		$ext = '';
		foreach($chunk as $name)
		{
			$val = $new_settings[$name];
			if(in_array($name, $adiinviter->html_encoded_settings) && is_string($val))
			{
				$val = htmlentities($val);
			}
			if(in_array($name, $adiinviter->json_encoded_settings) && is_array($val))
			{
				$val = json_encode($val);
			}
			$query .= $ext . "('".$name."', '".$adiinviter->db->adi_escape_string($val)."')";
			$ext = ',';
		}
